import React, { Component } from 'react';
import './Home.css';
import Header from '../../components/Header/Header';

class Home extends Component {
  render() {
    return (
      <div className="HomePage">
        {/* <header className="App-header"> */}
        <img src={require('../../assets/img/red_cross.jpg')} alt="red cross" className="logoImage"/>
        <h1>Welcome to the Centennial Health Portal</h1>
      </div>
    );
  }
}

export default Home;
